import "../Admin/Style/UploadTeacherData.css";

function UploadTeacherData() {
    
    return (
        <>
            <section className="upload-teachers-section">
                <div className="upload-teachers-container">
                    <h1>Upload Teacher Data</h1>
                    <form className="upload-teachers-form">
                        <input type="text" placeholder="Teacher's Name" required />
                        <input type="text" placeholder="Teacher's NIP" required />
                        <input type="text" placeholder="Teacher's Pelajaran" required />
                        <input type="file" />
                        <button type="submit">Submit</button>
                    </form>
                </div>
            </section>
        </>
    );
}

export default UploadTeacherData;
